import React, { Component } from 'react';
import './App.css';
import HomePage from './page/HomePage';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import OnePage from './page/OnePage';

class App extends Component {

  render() {
    return (
      <div style={{ marginLeft: 15 ,}}>

        <Router>
          <div>

            <Link to="/"><p style={{ fontSize: 20, fontWeight: 'bold', display: 'inline-block' }}>Quession One</p></Link>
            <Link to="/Three"> <p style={{ fontSize: 20, fontWeight: 'bold', display: 'inline-block', marginLeft: 20 }}>Quession Three</p></Link>
            <Route exact path="/" component={HomePage} />
            <Route path="/Three" component={OnePage} />
          </div>
        </Router>

      </div>
    );
  }
}

export default App;
